import { Suspense } from "react";
import { Slide, ToastContainer } from "react-toastify";
import { Routes, Route } from "react-router-dom";
import Home from "./components/Home";
import Sidebar from "./components/Sidebar";

function App() {
  return (
    <><Sidebar /><Suspense fallback={<h1>Loading...</h1>}>
      <Routes>
        <Route exact path="/" element={<Home />} />
      </Routes>
      <ToastContainer
        position="top-right"
        hideProgressBar={false}
        newestOnTop={true}
        closeOnClick
        rtl={false}
        pauseOnFocusLoss
        draggable
        pauseOnHover
        theme="light"
        transition={Slide}
        autoClose={5000} />
    </Suspense></>
  );
}

export default App;
